/*!

=========================================================
* Paper Dashboard React - v1.2.0
=========================================================

* Product Page: https://www.creative-tim.com/product/paper-dashboard-react
* Copyright 2020 Creative Tim (https://www.creative-tim.com)

* Licensed under MIT (https://github.com/creativetimofficial/paper-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
import ReactDOM from "react-dom";

import "bootstrap/dist/css/bootstrap.css";
import "assets/scss/paper-dashboard.scss?v=1.2.0";

import { DashboardProvider } from "context/DashboardContext.js"
import { MapsProvider } from "context/MapsContext";
import { WarningsProvider } from "context/WarningsContext";
import { VehicleProvider } from "context/VehicleContext";
import { NavigationProvider } from "context/NavigationContext";
import { AuditorsProvider } from "context/AuditorsContext";
import { GroupsProvider } from "context/GroupsContext";
import { LoginProvider } from "context/LoginContext";
import { ViewsProvider } from "context/ViewsContext";
import { WarningsUpdateProvider } from "context/WarningsUpdateContext";

import App from "App";


ReactDOM.render(
  <VehicleProvider>
    <DashboardProvider>
      <LoginProvider>
        <MapsProvider>
          <NavigationProvider>
            <WarningsProvider>
              <AuditorsProvider>
                <GroupsProvider>
                  <ViewsProvider>
                    <WarningsUpdateProvider>
                      <App />
                    </WarningsUpdateProvider>
                  </ViewsProvider>
                </GroupsProvider>
              </AuditorsProvider>
            </WarningsProvider>
          </NavigationProvider>
        </MapsProvider>
      </LoginProvider>
    </DashboardProvider>
  </VehicleProvider>
  ,
  document.getElementById("root")
);
